import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
  button: {
    border: `1px solid ${theme.palette.divider}`,
    borderRadius: 0,
    width: '200px',
    backgroundColor: 'transparent'
  },
  buttonText: {
    fontSize: '0.75rem'
  }
}));

export default useStyles
